import React from "react";

function Footer() {
  return (
    <footer>
      <a name="contact"></a>
      <h1 className="contact">Contact Info</h1>
      <a href="http://" className="contact">
        Phone: (210) 209-0264
      </a>
      <a href="http://" className="contact">
        Email: Djay8400@gmail.com
      </a>
    </footer>
  );
}

export default Footer;
